script: |
  super -f text -I q10505.spq | sort > q10505.out

inputs:
  - name: q10505.spq
    data: |
      SELECT cor0.col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) BETWEEN + col1 + + col2 * + col2 AND ( + col1 * cor0.col0 + - col0 * col0 );
  - name: tab2

outputs:
  - name: q10505.out
    data: |
